import React from 'react';

function App() {
  return (
    <div className="App">
      <header>
        <img src='https://i.pinimg.com/originals/33/b8/69/33b869f90619e81763dbf1fccc896d8d.jpg' width='100px' />
      </header>

      <nav>
        <div>
          Profile
          </div>

      </nav>

      <div>
        Main content
      </div>


    </div>
  );
}

export default App;
